DROP TABLE IF EXISTS md_cm_bp_time;
CREATE TABLE md_cm_bp_time(
time_key int,
time_short varchar,
time_long varchar,
hour_part int,
min_part int,
time_peroid_std varchar,
time_period_std_name_en varchar,
time_period_std_name_cn varchar,
time_period_12 varchar,
time_period_12_name_cn varchar,
is_working_time int,
min_period varchar

);
ALTER TABLE "md_cm_bp_time" 
ALTER COLUMN "time_key" SET NOT NULL,
ADD PRIMARY KEY ("time_key");

COMMENT ON COLUMN md_cm_bp_time.time_key is '二十四小时制的4位时间，格式：HHMM';
COMMENT ON COLUMN md_cm_bp_time.time_short is '短时间格式： 12:21';
COMMENT ON COLUMN md_cm_bp_time.time_long is '长时间格式：12点21份';
COMMENT ON COLUMN md_cm_bp_time.hour_part is '数字格式小时：0～23';
COMMENT ON COLUMN md_cm_bp_time.min_part is '数字格式分钟：0～59';
COMMENT ON COLUMN md_cm_bp_time.time_peroid_std is '字符串格式：00:00～04:00';
COMMENT ON COLUMN md_cm_bp_time.time_period_std_name_en is 'early morning、 morning、 midday、 afternoon';
COMMENT ON COLUMN md_cm_bp_time.time_period_std_name_cn is '上午、中午、下午、晚上';
COMMENT ON COLUMN md_cm_bp_time.time_period_12 is '字符串格式：23:00～01:00';
COMMENT ON COLUMN md_cm_bp_time.time_period_12_name_cn is '半夜、凌晨、黎明、清晨、早上、上午、中午、午后、下午';
COMMENT ON COLUMN md_cm_bp_time.is_working_time is '判断是否属于工作时间范围：0 => 否、1 => 是';
COMMENT ON COLUMN md_cm_bp_time.min_period is '按10分钟为一个分组：00:10，00:20，00:30';


